he National Junior Tennis League. The three friends envisioned the NJTL as way to reach young, inner-city youth and use tennis as a platform to teach them the importance of character, getting an education and becoming productive citizens.\r\n<br><br>\r\nToday, NJTL stands for National Junior Tennis and Learning. The goals remain the same and are upheld by 300 nonprofit youth organizations (called NJTL Chapters) around the country.\r\n<br><br>\r\nImpacting about 180,000 under-resourced youth each year, these chapters offer free or low-cost after-school tutoring that focuses on academic enrichment, a life-skills curriculum, and tennis. The USTA Foundation supports the NJTL Network.\r\nIn New England, the New England Tennis and Education Foundation further supports the 16 New England Chapters that impact around 13,000 youth every year.'),(1203,125,'_wws_body_1','field_5ff28580f34a2'),(1204,125,'wws_button_text_1','discover NJTLs'),(1205,125,'_wws_button_text_1','field_5ff28592f34a3'),(1206,125,'wws_button_link_1','http://127.0.01'),(1207,125,'_wws_button_link_1','field_5ff285a3f34a4'),(1208,125,'wws_video_1','https://via.placeholder.com/750x400'),(1209,125,'_wws_video_1','field_5ffe2d403c0d3'),(1210,125,'wws_video_2','https://via.placeholder.com/750x400'),(1211,125,'_wws_video_2','field_5ffe2d70f1516'),(1212,126,'_edit_last','1'),(1213,126,'_edit_lock','1610501625:1'),(1214,131,'_edit_lock','1610502281:1'),(1217,131,'_edit_last','1'),(1218,131,'os_title','Story 1'),(1219,131,'_os_title','field_5ffe4d163a55c'),(1220,131,'os_text','TEt qui cum facea volor sita nost, nat rem et a quamet od evelias asinvelique sus es poribus am nus acepturia ne libusanimus excest, quae molliqu aturiasped ma voles quianihites re maximuscidis eniti odi doluptatur?\r\nXimi, omnihic aborepro dunt volutatur? Edio. Derum nonet que cupider ionsedio .'),(1221,131,'_os_text','field_5ffe4d233a55d'),(1222,131,'os_button_text','link to full story'),(1223,131,'_os_button_text','field_5ffe4d2e3a55e'),(1